INSERT INTO `ll_categorie` VALUES (1,1,31,1,1,'0','Ok','2014-01-07 12:04:01','2014-01-27 12:04:01','Accessibilité','Les logiciels facilitant l\'utilisation de l\'ordinateur pour les personnes présentant des incapacités physiques. ',1),(2,1,31,1,1,'0','Ok','2014-01-07 12:04:02','2014-01-27 12:04:02','Bureautique','Les logiciels utilisés pour la production de documents informatiques (traitement de texte, feuilles de calcul, présentations, etc.). ',1),(3,1,31,1,1,'0','Ok','2014-01-07 12:04:03','2014-01-27 12:04:03','Cartographie conceptuelle','Les logiciels utilisés pour illustrer, de façon graphique, les liens entre différents concepts et idées.',1),(4,1,31,1,1,'0','Ok','2014-01-07 12:04:04','2014-01-27 12:04:04','Comptabilité et finances','Les logiciels facilitant la réalisation de tâches comptables et financières.',1),(5,1,31,1,1,'0','Ok','2014-01-07 12:04:05','2014-01-27 12:04:05','Émulateurs','Les logiciels permettant d\'exécuter un programme conçu pour un environnement différent du système d\'exploitation hôte.',1),(6,1,31,1,1,'0','Ok','2014-01-07 12:04:06','2014-01-27 12:04:06','Gestion de projets','Les logiciels offrant la planification de tâches et l\'allocation de ressources dans le but de faciliter la gestion d\'un projet. ',1),(7,1,31,1,1,'0','Ok','2014-01-07 12:04:07','2014-01-27 12:04:07','Gestion des postes et des connexions à distance','Les logiciels permettant de se connecter à distance sur un autre poste, d\'en prendre le contrôle et de gérer sa configuration.',1),(8,1,31,1,1,'0','Ok','2014-01-07 12:04:08','2014-01-27 12:04:08','Graphisme','Les logiciels servant à la production graphique d\'images.',1),(9,1,31,1,1,'0','Ok','2014-01-07 12:04:09','2014-01-27 12:04:09','Courriels et logiciels collaboratifs','Les logiciels permettant de lire, d\'envoyer des courriels, et de collaborer via diverses fonctions, comme les agendas et les tâches partagées.',1),(10,1,31,1,1,'0','Ok','2014-01-07 12:04:10','2014-01-27 12:04:10','Lecteurs RSS','Les logiciels permettant la lecture de flux RSS.',1),(11,1,31,1,1,'0','Ok','2014-01-07 12:04:11','2014-01-27 12:04:11','Messagerie instantanée','Les logiciels offrant une communication textuelle, en direct, entre deux parties ou plus.',1),(12,1,31,1,1,'0','Ok','2014-01-07 12:04:12','2014-01-27 12:04:12','Navigateurs Web','Les logiciels permettant de visualiser des pages Web.',1),(13,1,31,1,1,'0','Ok','2014-01-07 12:04:13','2014-01-27 12:04:13','Transfert de fichiers','Les logiciels permettant de transférer des fichiers d\'une machine à une autre à l\'aide de divers protocoles (FTP, SFTP, etc.).',1),(14,1,31,1,1,'0','Ok','2014-01-07 12:04:14','2014-01-27 12:04:14','Voix sur IP','Les logiciels offrant un service de téléphonie par Internet.',1),(15,1,31,1,1,'0','Ok','2014-01-07 12:04:15','2014-01-27 12:04:15','Jeux','Les logiciels pour divertissement.',1),(16,1,31,1,1,'0','Ok','2014-01-07 12:04:16','2014-01-27 12:04:16','Logiciels éducatifs','Les logiciels ayant comme but de former et d\'instruire.',1),(17,1,31,1,1,'0','Ok','2014-01-07 12:04:17','2014-01-27 12:04:17','Multimédia ','Les logiciels servant à la consultation ou à la production de contenu multimédia audio et vidéo.',1),(18,1,31,1,1,'0','Ok','2014-01-07 12:04:18','2014-01-27 12:04:18','Outils d\'administration système','Les logiciels facilitant l\'administration du poste de travail.',1),(19,1,31,1,1,'0','Ok','2014-01-07 12:04:19','2014-01-27 12:04:19','Publication assistée par ordinateur ','Les logiciels utilisés pour préparer la production de documents destinés à l\'impression (mise en page, génération de PDF).',1),(20,1,31,1,1,'0','Ok','2014-01-07 12:04:20','2014-01-27 12:04:20','Utilitaires','Les logiciels offrant divers services utiles comme la compression de fichiers, la capture d’écrans, Etc.',1),(21,1,31,1,1,'0','Ok','2014-01-07 12:04:21','2014-01-27 12:04:21','Virtualisation','Les logiciels permettant l\'exécution d\'un système d\'exploitation tiers, par exemple l\'exécution d\'un système Windows sous Linux.',1),(22,1,31,1,1,'0','Ok','2014-01-07 12:04:22','2014-01-27 12:04:22','Gestion de grappes (clustering)','Les outils permettant la gestion de grappes de calculs. ',1),(23,1,31,1,1,'0','Ok','2014-01-07 12:04:23','2014-01-27 12:04:23','Gestion de listes de diffusion','Les outils permettant la création, l\'administration et l\'envoi de courriels de listes de diffusion.',1),(24,1,31,1,1,'0','Ok','2014-01-07 12:04:24','2014-01-27 12:04:24','Gestion de parc','Les outils facilitant l\'inventaire, le contrôle des postes et l\'administration distante automatisée d\'un parc informatique. ',1),(25,1,31,1,1,'0','Ok','2014-01-07 12:04:25','2014-01-27 12:04:25','Gestion de processus d\'affaires','L’ensemble des logiciels permettant la modélisation des processus métiers d\'une entreprise puis leur exécution concrète en interaction avec les différents systèmes d\'information de l\'organisation.',1),(26,1,31,1,1,'0','Ok','2014-01-07 12:04:26','2014-01-27 12:04:26','Gestion électronique des documents','Les systèmes facilitant la gestion du cycle de vie des documents électroniques.',1),(27,1,31,1,1,'0','Ok','2014-01-07 12:04:27','2014-01-27 12:04:27','Moteurs de recherche','Les logiciels offrant une fonction d\'indexation et de recherche dans les bases de données, les fichiers et les autres sources d\'information, et offrant habituellement une interface Web à l\'utilisateur permettant la saisie de mots-clés et de critères de recherche.',1),(28,1,31,1,1,'0','Ok','2014-01-07 12:04:28','2014-01-27 12:04:28','Outils de haute disponibilité','Les logiciels permettant à un ensemble de machines de fournir un service commun avec un haut taux de disponibilité. ',1),(29,1,31,1,1,'0','Ok','2014-01-07 12:04:29','2014-01-27 12:04:29','Outils de surveillance (monitoring)','Les logiciels permettant de surveiller l\'état des serveurs et de l\'infrastructure informatique d\'une organisation.',1),(30,1,31,1,1,'0','Ok','2014-01-07 12:04:30','2014-01-27 12:04:30','Plateformes de virtualisation','Les logiciels permettant l\'exécution simultanée de plusieurs systèmes d\'exploitation indépendants se partageant les ressources d\'un même serveur physique. ',1),(31,1,31,1,1,'0','Ok','2014-01-07 12:04:31','2014-01-27 12:04:31','Plateformes implantant le concept d\'architecture orientée services','Les plateformes implantant un modèle d\'interaction entre les composants logiciels encapsulés et indépendants, appelés services, et représentant les processus métiers de l\'entreprise. Ces services communiquent habituellement entre eux à travers un médiateur offert par la plateforme et le bus de service (enterprise service bus).',1),(32,1,31,1,1,'0','Ok','2014-01-07 12:04:32','2014-01-27 12:04:32','Plateformes pour clients légers','Les logiciels permettant la réalisation d\'une infrastructure distribuée là où un serveur central assure le traitement des applications qui sont affichées de manière distante sur des terminaux pouvant servir de postes de travail.',1),(33,1,31,1,1,'0','Ok','2014-01-07 12:04:33','2014-01-27 12:04:33','Portails','Les sites Web offrant au visiteur des liens vers les différents services et ressources de l\'organisation : courriel, intranet, système de gestion du contenu, moteur de recherche, etc.',1),(34,1,31,1,1,'0','Ok','2014-01-07 12:04:34','2014-01-27 12:04:34','Progiciels de gestion intégrés (ERP)','Les progiciels assurant la gestion de l\'ensemble des processus d\'une entreprise.',1),(35,1,31,1,1,'0','Ok','2014-01-07 12:04:35','2014-01-27 12:04:35','Antivirus','Les logiciels utilisés pour la détection et la prévention de l\'apparition de parasites et de virus sur un système informatique.',1),(36,1,31,1,1,'0','Ok','2014-01-07 12:04:36','2014-01-27 12:04:36','Filtres antipourriels','Les logiciels permettant l\'identification et le rejet de courriels indésirables.',1),(37,1,31,1,1,'0','Ok','2014-01-07 12:04:37','2014-01-27 12:04:37','Sécurité du réseau','Le coupe-feu, les outils de détection et de prévention d\'intrusion et les autres outils relatifs à la protection et à la sécurisation d\'un réseau.',1),(38,1,31,1,1,'0','Ok','2014-01-07 12:04:38','2014-01-27 12:04:38','Services d\'annuaire','Les services centralisés qui regroupent de l\'information sur les utilisateurs, permettant ainsi à diverses applications de répertorier et de vérifier certaines informations (courriel, nom, nom d\'utilisateur, mot de passe, etc.). Les services d’annuaire sont également utilisés ',1),(39,1,31,1,1,'0','Ok','2014-01-07 12:04:39','2014-01-27 12:04:39','Services d\'authentification unique','Les logiciels permettant à un utilisateur de s\'authentifier une seule fois sur le réseau et d\'accéder à un ensemble d\'applications hétérogènes sans avoir besoin de s\'authentifier à nouveau.',1),(40,1,31,1,1,'0','Ok','2014-01-07 12:04:40','2014-01-27 12:04:40','Services réseau partagés essentiels','Services de gestion du réseau, comme les serveurs de résolution de nom (DNS), les serveurs DHCP et les serveurs mandataires (proxy).',1),(41,1,31,1,1,'0','Ok','2014-01-07 12:04:41','2014-01-27 12:04:41','Services réseau partagés connexes','Les autres services réseau partagés connexes, comme les serveurs d\'impression, de messagerie instantanée et autres.',1),(42,1,31,1,1,'0','Ok','2014-01-07 12:04:42','2014-01-27 12:04:42','Serveurs d’applications','Les cadres applicatifs permettant la mise en commun de services dédiés à l\'exécution d\'applications serveur.',1),(43,1,31,1,1,'0','Ok','2014-01-07 12:04:43','2014-01-27 12:04:43','Serveurs de collecticiel','Les logiciels permettant le travail collaboratif, côté serveur. Il est à noter qu\'un grand nombre de fonctions de ces serveurs peuvent être assurées par d\'autres catégories de logiciels (serveurs de courriels, serveurs de fichiers, gestionnaires de contenu, etc.).',1),(44,1,31,1,1,'0','Ok','2014-01-07 12:04:44','2014-01-27 12:04:44','Serveurs de courriels','Les serveurs permettant la réception et la livraison de courriels (SMTP), ainsi que l\'accès aux courriels (IMAP-IMAPs, POP3- POP3s).',1),(45,1,31,1,1,'0','Ok','2014-01-07 12:04:45','2014-01-27 12:04:45','Serveurs de fichiers','Les serveurs permettant à un ensemble d\'utilisateurs d\'accéder à des fichiers communs via différents protocoles (protocole FTP, NFS, SMB, etc.).',1),(46,1,31,1,1,'0','Ok','2014-01-07 12:04:46','2014-01-27 12:04:46','Serveurs de réseaux privés virtuels (RPV)','Les serveurs offrant la possibilité de relier une machine distante au réseau local d\'une organisation via un tunnel sécurisé dans l\'Internet (en anglais, VPN).',1),(47,1,31,1,1,'0','Ok','2014-01-07 12:04:47','2014-01-27 12:04:47','Serveurs de téléphonie IP','Les systèmes offrant des services de voix sur IP.',1),(48,1,31,1,1,'0','Ok','2014-01-07 12:04:48','2014-01-27 12:04:48','Serveurs Web','Les serveurs fournissant des documents accessibles via un navigateur Web.',1),(49,1,31,1,1,'0','Ok','2014-01-07 12:04:49','2014-01-27 12:04:49','Solutions de formation en ligne','Les logiciels Web regroupant la documentation pertinente et différentes fonctions pour appuyer les cours dispensés en personne ou de façon virtuelle.',1),(50,1,31,1,1,'0','Ok','2014-01-07 12:04:50','2014-01-27 12:04:50','Systèmes d\'information géographique','Les systèmes permettant le traitement, l\'affichage et l\'impression de cartes et de données géographiques.',1),(51,1,31,1,1,'0','Ok','2014-01-07 12:04:51','2014-01-27 12:04:51','Systèmes de gestion de bases de données','Les systèmes de stockage de données optimisés pour conserver des informations volumineuses variant fréquemment.',1),(52,1,31,1,1,'0','Ok','2014-01-07 12:04:52','2014-01-27 12:04:52','Systèmes de gestion de contenu','Les systèmes permettant à plusieurs individus de travailler sur un contenu commun dans le but éventuel de le publier sur Internet.',1),(53,1,31,1,1,'0','Ok','2014-01-07 12:04:53','2014-01-27 12:04:53','Systèmes de sauvegarde','Les systèmes de stockage de données optimisés pour conserver des informations volumineuses variant fréquemment.',1),(54,1,31,1,1,'0','Ok','2014-01-07 12:04:54','2014-01-27 12:04:54','Systèmes de suivi des requêtes','Les systèmes gérant la liste des requêtes d\'une organisation et permettant le suivi du cycle de vie de ces requêtes. Les bogues peuvent être considérés comme un cas particulier de requêtes.',1),(55,1,31,1,1,'0','Ok','2014-01-07 12:04:55','2014-01-27 12:04:55','Wikis','Les systèmes de gestion du contenu collaboratif où tous les utilisateurs peuvent contribuer à la rédaction du contenu.',1),(56,1,31,1,1,'0','Ok','2014-01-07 12:04:56','2014-01-27 12:04:56','Bibliothèques de codes (libraries)','Ensemble de fonctions et de classes regroupées, par thèmes ou par fonctionnalité, et offrant des services partagés à d\'autres programmes.',1),(57,1,31,1,1,'0','Ok','2014-01-07 12:04:57','2014-01-27 12:04:57','Cadres d\'applications (frameworks)','Groupes constitués de bibliothèques de codes offrant à un programmeur la possibilité de développer rapidement une application de manière aisée.',1),(58,1,31,1,1,'0','Ok','2014-01-07 12:04:58','2014-01-27 12:04:58','Compilateurs','Les outils transformant les instructions de haut niveau d\'un langage de programmation donné en instructions binaires compréhensibles par un processeur.',1),(59,1,31,1,1,'0','Ok','2014-01-07 12:04:59','2014-01-27 12:04:59','Débogueurs','Les outils permettant de faire la trace de l\'exécution d\'un programme dans le but d\'en trouver les bogues.',1),(60,1,31,1,1,'0','Ok','2014-01-07 12:05:00','2014-01-27 12:05:00','Éditeurs','Les logiciels permettant l\'édition de documents textes et de programmes sans mise en forme.',1),(61,1,31,1,1,'0','Ok','2014-01-07 12:05:01','2014-01-27 12:05:01','Environnements intégrés de développement','Les logiciels intégrant un éditeur évolué et spécialisé pour la programmation, un débogueur, des outils de tests, et d\'autres outils spécifiques au domaine.',1),(62,1,31,1,1,'0','Ok','2014-01-07 12:05:02','2014-01-27 12:05:02','Interpréteurs et langages de script','Les logiciels permettant l\'exécution de programmes écrits dans un langage de haut niveau.',1),(63,1,31,1,1,'0','Ok','2014-01-07 12:05:03','2014-01-27 12:05:03','Outils de modélisation','Les outils facilitant la conception et la reproduction de schémas modélisant un logiciel.',1),(64,1,31,1,1,'0','Ok','2014-01-07 12:05:04','2014-01-27 12:05:04','Système de gestion de versions','Les systèmes conservant sur un serveur central le code source de programmes et permettant le versionnement et le suivi des changements de ce code.',1),(65,1,31,1,1,'0','Ok','2014-01-07 12:05:05','2014-01-27 12:05:05','Système de gestion des anomalies','Le logiciel gérant la liste des bogues et des requêtes associés au développement d\'un logiciel et permettant le suivi du cycle de vie de ces requêtes.',1),(71,5,31,5,5,'0','Ok','2014-01-30 11:58:11','2014-01-30 11:58:11','Logiciel prêt à l\'emploi','Les logiciels autoportants qui ne nécessitent pas de service professionnel et peuvent être utilisés par le grand public sans difficulté.',3),(72,5,31,5,5,'0','Ok','2014-01-30 11:58:29','2014-01-30 11:58:29','Logiciel intermédiaire','Les logiciels qui pourraient être adoptés avec un support de communauté ou avec un support professionnel indépendant. Ces logiciels peuvent être détachés du service (on choisit le logiciel pour adoption et tout fournisseur peut assurer le service).',3),(73,5,31,5,5,'0','Ok','2014-01-30 11:58:46','2014-01-30 11:58:46','Logiciel lourd','Les logiciels qui nécessitent un support professionnel et qu\'il faut adopter avec service (exemples : progiciel de gestion intégrée, dossier de santé).',3),(74,5,31,5,5,'0',NULL,'2014-02-11 10:03:00','2014-02-11 10:03:00','Antivirus','',2),(75,5,31,5,5,'0',NULL,'2014-02-11 10:03:49','2014-02-11 10:03:49','Apprentissage en ligne','',2),(76,5,31,5,5,'0',NULL,'2014-02-11 10:04:02','2014-02-11 10:04:02','Archivage','',2),(77,5,31,5,5,'0',NULL,'2014-02-11 10:04:18','2014-02-11 10:04:18','Authentification unique - SSO','',2),(78,5,31,5,5,'0',NULL,'2014-02-11 10:04:33','2014-02-11 10:04:33','Base de données','',2),(79,5,31,5,5,'0',NULL,'2014-02-11 10:04:48','2014-02-11 10:04:48','BI','',2),(80,5,31,5,5,'0',NULL,'2014-02-11 10:05:06','2014-02-11 10:05:06','Clients légers','',2),(81,5,31,5,5,'0',NULL,'2014-02-11 10:05:28','2014-02-11 10:05:28','CMS','Un système de gestion de contenu ou SGC (Content Management System ou CMS) est une famille de logiciels destinés à la conception et à la mise à jour dynamique de sites Web ou d\'applications multimédia. Lorsque le SGC gère du contenu dynamique, on parle de système de gestion de contenu dynamique ou SGCD (Dynamic Content Management System ou DCMS). Les SGC ne doivent pas être confondus avec les systèmes de gestion électronique des documents (GED) qui permettent de réaliser la gestion de contenu dans l\'entreprise.',2),(82,5,31,5,5,'0',NULL,'2014-02-11 10:05:53','2014-02-11 10:05:53','CRM','La gestion de la relation client (GRC), connue aussi sous son nom français correct de gestion des relations avec les clients (GRC), et sous sa traduction anglaise Customer Relationship Management (CRM), est définie comme suit par le CXP Centre d\'eXpertise des Progiciels), cité par Jean-Louis Tomas : « La GRC est l\'ensemble des outils et techniques destinés à capter, traiter, analyser les informations relatives aux clients et aux prospects, dans le but de les fidéliser en leur offrant le meilleur service. » « En termes d\'applications informatiques, il s\'agit des progiciels qui permettent de traiter directement avec le client, que ce soit au niveau de la vente, du marketing ou du service, et que l\'on regroupe souvent sous le terme de \"front-office\", ceci par opposition aux outils de \"back-office\" que sont les progiciels de gestion intégrés (ou ERP). »',2),(83,5,31,5,5,'0',NULL,'2014-02-11 10:06:18','2014-02-11 10:06:18','ECM','La gestion de contenu (en anglais Enterprise Content Management : ECM) vise à gérer l\'ensemble des contenus d\'une organisation. Il s\'agit de prendre en compte sous forme électronique les informations qui ne sont pas structurées, comme les documents électroniques, par opposition à celles déjà structurées dans les bases de données. À titre d\'exemple, une application de gestion de contenu servira à gérer l\'ensemble des informations d\'un dossier client : courriers papier, courriels, télécopie, contrats, etc., dans une même infrastructure.',2),(84,5,31,5,5,'0',NULL,'2014-02-11 10:06:31','2014-02-11 10:06:31','Environnement de développement intégré','',2),(85,5,31,5,5,'0',NULL,'2014-02-11 10:06:45','2014-02-11 10:06:45','Géomatique et SIG','',2),(86,5,31,5,5,'0',NULL,'2014-02-11 10:07:01','2014-02-11 10:07:01','Gestion de clés publiques','',2),(87,5,31,5,5,'0',NULL,'2014-02-11 10:07:21','2014-02-11 10:07:21','Logiciel de comptabilité','',2),(88,5,31,5,5,'0',NULL,'2014-02-11 10:07:34','2014-02-11 10:07:34','Logiciel de sauvegarde','',2),(89,5,31,5,5,'0',NULL,'2014-02-11 10:07:49','2014-02-11 10:07:49','Logiciel de synchronisation mobile','',2),(90,5,31,5,5,'0',NULL,'2014-02-11 10:08:02','2014-02-11 10:08:02','Moteur de recherche','',2),(91,5,31,5,5,'0',NULL,'2014-02-11 10:08:23','2014-02-11 10:08:23','PABX','Dans l\'industrie des télécommunications, on désigne par PABX IP (PBX IP ou encore IPBX) un autocommutateur téléphonique privé utilisant le protocole internet (IP) pour gérer les appels téléphoniques d\'une entreprise, en interne sur son réseau local (LAN). Couplé à des technologies de voix sur IP, les communications téléphoniques pourront être acheminées sur le réseau étendu (WAN) de l\'entreprise. On utilise en général le terme « PABX IP » lorsque l\'on cherche à distinguer un système de téléphonie sur IP des systèmes de téléphonie à commutation de circuits numériques traditionnels (PABX). Le PABX IP est l\'évolution vers l\'IP du PABX traditionnel. Autrement, On parle simplement de PABX.',2),(92,5,31,5,5,'0',NULL,'2014-02-11 10:08:38','2014-02-11 10:08:38','Progiciel de gestion intégré','',2),(93,5,31,5,5,'0',NULL,'2014-02-11 10:08:51','2014-02-11 10:08:51','Serveur mail','',2),(94,5,31,5,5,'0',NULL,'2014-02-11 10:09:07','2014-02-11 10:09:07','SGIB','',2),(95,5,31,5,5,'0',NULL,'2014-02-11 10:09:24','2014-02-11 10:09:24','Signature électronique','',2),(96,5,31,5,5,'0',NULL,'2014-02-11 10:09:39','2014-02-11 10:09:39','Suite collaborative','',2),(97,5,31,5,5,'0',NULL,'2014-02-11 10:09:50','2014-02-11 10:09:50','Suite d\'édition','',2),(98,5,31,5,5,'0',NULL,'2014-02-11 10:10:05','2014-02-11 10:10:05','Surveillance réseau/système','',2),(99,5,31,5,5,'0',NULL,'2014-02-11 10:10:18','2014-02-11 10:10:18','Système d\'exploitation','',2),(100,5,31,5,5,'0',NULL,'2014-02-11 10:10:31','2014-02-11 10:10:31','Wiki','',2);
