  `smOwningTeam_id` int(11) DEFAULT NULL,
  `smCreatedBy_id` int(11) DEFAULT NULL,
  `smModifiedBy_id` int(11) DEFAULT NULL,
  `smRegStatus` varchar(50) DEFAULT NULL,
  `smWflowStatus` varchar(50) DEFAULT NULL,
  `smCreatedOn` datetime DEFAULT NULL,
  `smModifiedOn` datetime DEFAULT NULL,
  `cat_class_id` int(11) NOT NULL,
  `log_class_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `cat_class_id` (`cat_class_id`,`log_class_id`),
  KEY `ll_classification_51907373` (`smOwningUser_id`),
  KEY `ll_classification_2bbada35` (`smOwningTeam_id`),
  KEY `ll_classification_e4fef1e4` (`smCreatedBy_id`),
  KEY `ll_classification_6071c14a` (`smModifiedBy_id`),
  KEY `ll_classification_8bec9458` (`cat_class_id`),
  KEY `ll_classification_fc0f3e92` (`log_class_id`),
