INSERT INTO `ll_logiciel` VALUES (1,5,31,5,5,'0','Ok','2014-02-14 11:38:25','2014-02-14 11:38:25','7-Zip','http://7-zip.org/','http://sourceforge.net/projects/sevenzip/','7-Zip est un logiciel gratuit d\'archivage de fichiers avec un taux de compression très élevé.7-Zip est un logiciel open source. La plupart du code est sous licence GNU LGPL. Le code un RAR est sous licence mixte: GNULGPL+un RAR restriction.7-Zip peut être utilisé sur n\'importe quel ordinateur, y compris dans les sociétés commerciales. Il n\'est pas nécessaire de s\'enregistrer ou payer pour utiliser7-Zip. ',0,'',NULL),(2,5,31,5,5,'0','Ok','2014-01-07 12:04:02','2014-01-27 12:04:02','ActivePerl','http://www.activestate.com/activeperl',NULL,'ActivePerl allows for programmers to use Perl-based code in addition to, or in place of, VBScript or JScript in the context of web servers running the ASP protocol.',0,NULL,NULL),(3,5,31,5,5,'0','Ok','2014-01-07 12:04:03','2014-01-27 12:04:03','ADM','http://adm.sourceforge.net/',NULL,'Open source application which interfaces your VOIP telephony with the desktop and Asterisk PBX.',0,NULL,NULL),(4,5,31,5,5,'0','Ok','2014-02-20 15:14:41','2014-02-20 15:14:41','Alfresco','http://www.alfresco.com/','http://www.alfresco.com/fr','Alfresco est une plateforme de collaboration et de gestion des contenus critiques de l\'entreprise. Elle facilite la gestion des processus à gros volumes de documents et permet de collaborer en toute sécurité. ',1,'',NULL),(5,5,31,5,5,'0','Ok','2014-02-13 10:25:22','2014-02-13 10:25:22','AMaVIS','http://amavis.org/','http://sourceforge.net/projects/amavis/','AMaViS is a script that interfaces a mail transport agent (MTA) with virus scanners.',0,'',NULL),(6,5,31,5,5,'0','Ok','2014-01-07 12:04:06','2014-01-27 12:04:06','Apache Ant','http://ant.apache.org/','http://projects.apache.org/projects/ant.html','Apache Ant is a Java library and command-line tool whose mission is to drive processes described in build files as targets and extension points dependent upon each other. The main known usage of Ant is the build of Java applications. Ant supplies a number of built-in tasks allowing to compile, assemble, test and run Java applications ',0,NULL,NULL),(7,5,31,5,5,'0','Ok','2014-01-07 12:04:06','2014-01-27 12:04:06','Apache HTTP Server','http://www.apache.org/','http://projects.apache.org/projects/http_server.html','The Apache HTTP Server is an open-source HTTP server for modern operating systems including UNIX, Microsoft Windows, Mac OS/X and Netware. ',0,NULL,NULL),(8,5,31,5,5,'0','Ok','2014-01-07 12:04:06','2014-01-27 12:04:06','Apache log4net','http://www.apache.org/','http://projects.apache.org/projects/log4net.html','Apache log4net provides logging services for .NET.',0,NULL,NULL),(9,5,31,5,5,'0','Ok','2014-01-07 12:04:06','2014-01-27 12:04:06','Apache Lucene Core','http://www.apache.org/','http://projects.apache.org/projects/lucene_core.html','Apache Lucene is a high-performance, full-featured text search engine library written entirely in Java. It is a technology suitable for nearly any application that requires full-text search, especially cross-platform. ',0,NULL,NULL),(10,5,31,5,5,'0','Ok','2014-01-07 12:04:06','2014-01-27 12:04:06','Apache Solr','http://www.apache.org/','http://projects.apache.org/projects/solr.html','Solr is an open source enterprise search server based on the Lucene Java search library, with XML/HTTP and JSON, Ruby, and Python APIs, hit highlighting, faceted search, caching, replication, and a web administration interface.',0,NULL,NULL),(11,5,31,5,5,'0','Ok','2014-01-07 12:04:07','2014-01-27 12:04:07','Asterisk','http://www.asterisk.org/',NULL,'Asterisk is a free and open source framework for building communications applications and is sponsored by Digium.',0,NULL,NULL),(12,5,31,5,5,'0','Ok','2014-01-07 12:04:08','2014-01-27 12:04:08','Audacity','http://audacity.sourceforge.net/',NULL,'Audacity is free, open source, cross-platform software for recording and editing sounds.',0,NULL,NULL),(13,5,31,5,5,'0','Ok','2014-01-07 12:04:09','2014-01-27 12:04:09','AviSynth','http://avisynth.nl/index.php/Main_Page/fr',NULL,'AviSynth est un puissant outil de postproduction vidéo. Il fournit un service d\'édition et de traitement vidéo. ',0,NULL,NULL),(14,5,31,5,5,'0','Ok','2014-01-07 12:04:10','2014-01-27 12:04:10','AWSTATS','http://awstats.sourceforge.net/',NULL,'AWStats is a free powerful and featureful tool that generates advanced web, streaming, ftp or mail server statistics, graphically.',0,NULL,NULL),(15,5,31,5,5,'0','Ok','2014-01-07 12:04:11','2014-01-27 12:04:11','AxCrypt','http://www.axantum.com/axcrypt/',NULL,'AxCrypt is the leading open source file encryption software for Windows.',0,NULL,NULL),(16,5,31,5,5,'0','Ok','2014-01-07 12:04:12','2014-01-27 12:04:12','BackupPC','http://backuppc.sourceforge.net/',NULL,'BackupPC is a high-performance, enterprise-grade system for backing up Linux, WinXX and MacOSX PCs and laptops to a server\'s disk. BackupPC is highly configurable and easy to install and maintain. ',0,NULL,NULL),(17,5,31,5,5,'0','Ok','2014-01-30 15:19:33','2014-01-30 15:19:33','Bacula','http://www.bacula.org/fr/','','Bacula est un ensemble de programmes qui vous permet de gérer vos sauvegardes, restaurations ou vérifications de données d\'un ordinateur sur un réseau hétérogène.',0,'',NULL),(18,5,31,5,5,'0','Ok','2014-01-07 12:04:14','2014-01-27 12:04:14','BeeCrypt','http://beecrypt.sourceforge.net/',NULL,'BeeCrypt is an ongoing project to provide a strong and fast cryptography toolkit. Includes entropy sources, random generators, block ciphers, hash functions, message authentication codes, multiprecision integer routines, and public key primitives.',0,NULL,NULL),(19,5,31,5,5,'0','Ok','2014-01-07 12:04:15','2014-01-27 12:04:15','BBWin','http://bbwin.sourceforge.net/',NULL,'BBWin is an open source client for Windows working with BigBrother or Xymon(Hobbit) monitoring software.',1,NULL,NULL),(20,5,31,5,5,'0','Ok','2014-02-07 13:17:16','2014-02-07 13:17:16','BigBlueButton','http://bigbluebutton.org/','','BigBlueButton is an open source web conferencing system for distance education. It provides real-time desktop sharing, presentation, VoIP, webcam and chat.',0,'',NULL),(21,5,31,5,5,'0','Ok','2014-01-07 12:04:17','2014-01-27 12:04:17','BIND','https://www.isc.org/downloads/bind/',NULL,'BIND is open source software that implements the Domain Name System (DNS) protocols for the Internet. It is a reference implementation of those protocols, but it is also production-grade software, suitable for use in high-volume and high-reliability applications.',0,NULL,NULL),(22,5,31,5,5,'0','Ok','2014-01-30 15:25:47','2014-01-30 15:25:47','Birt','http://www.eclipse.org/birt/phoenix/','','BIRT is an open source Eclipse-based reporting system that integrates with your Java/Java EE application to produce compelling reports. ',0,'',NULL),(23,5,31,5,5,'0','Ok','2014-02-07 13:33:08','2014-02-07 13:33:08','Blender','http://www.blender.org/','','Blender is a free and open source 3D animation suite. It supports the entirety of the 3D pipeline—modeling, rigging, animation, simulation, rendering, compositing and motion tracking, even video editing and game creation.',1,'',NULL),(24,5,31,5,5,'0','Ok','2014-01-07 12:04:20','2014-01-27 12:04:20','BlueGriffon','http://bluegriffon.org/',NULL,'BlueGriffon is an intuitive application that provides Web authors (beginners or more advanced) with a simple User Interface allowing to create attractive Web sites without requiring extensive technical knowledge about Web Standards.',0,NULL,NULL),(25,5,31,5,5,'0','Ok','2014-01-07 12:04:21','2014-01-27 12:04:21','BugTracker.NET','http://www.ifdefined.com/bugtrackernet.html','http://sourceforge.net/projects/btnet/?source=navbar','BugTracker.NET is a free, open-source, web-based bug tracking and general purpose issue tracking application. It is in daily use by thousands of development, customer support, and help desk teams around the world. ',0,NULL