 administrators and learners with a single robust, secure and integrated system to create personalised learning environments. You can download the software onto your own web server or ask one of our knowledgable Moodle Partners to assist you. ',0,NULL,NULL),(93,5,31,5,5,'0','Ok','2014-01-07 12:05:29','2014-01-27 12:05:29','MozillaSunBird','http://www.mozilla.org/projects/calendar/sunbird/',NULL,'Mozilla Sunbird® is a cross-platform calendar application built upon Mozilla Toolkit.',0,NULL,NULL),(94,5,31,5,5,'0','Ok','2014-01-07 12:05:30','2014-01-27 12:05:30','MozillaThunderbird','http://www.mozilla.org/fr/thunderbird/','http://www.mozilla.org/en-US/thunderbird/','Thunderbird est une application de messagerie facile à configurer et à personnaliser - et elle est remplie de fonctionnalités géniales !',0,NULL,NULL),(95,5,31,5,5,'0','Ok','2014-01-07 12:05:31','2014-01-27 12:05:31','MozillaMaintenanceService','http://www.mozilla.org/',NULL,'Firefox installe désormais un service optionnel appelé « Mozilla Maintenance Service ». Ce service permet à Firefox d\'installer des mises à jour sans que vous n\'ayez besoin de cliquer sur « Oui » dans la boîte de dialogue « Contrôle de compte utilisateur » (UAC). ',0,NULL,NULL),(96,5,31,5,5,'0','Ok','2014-01-07 12:05:32','2014-01-27 12:05:32','MRTG','http://oss.oetiker.ch/mrtg/',NULL,'You have a router, you want to know what it does all day long? Then MRTG is for you. It will monitor SNMP network devices and draw pretty pictures showing how much traffic has passed through each interface. Routers are only the beginning. MRTG is being used to graph all sorts of network devices as well as everything else from weather data to vending machines.',0,NULL,NULL),(97,5,31,5,5,'0','Ok','2014-01-07 12:05:33','2014-01-27 12:05:33','MySQL','http://www.mysql.fr/','http://www.mysql.com/','La Base de Données Open Source la plus Populaire au Monde.',0,NULL,NULL),(98,5,31,5,5,'0','Ok','2014-01-07 12:05:34','2014-01-27 12:05:34','Nagios','http://www.nagios.org/',NULL,'Achieve instant awareness of IT infrastructure problems, so downtime doesn\'t adversely affect your business. Nagios offers complete monitoring and alerting for servers, switches, applications, and services.',0,NULL,NULL),(99,5,31,5,5,'0','Ok','2014-01-07 12:05:35','2014-01-27 12:05:35','Nagvis','http://www.nagvis.org/',NULL,'NagVis is a visualization addon for the well known network managment system Nagios. NagVis can be used to visualize Nagios Data, e.g. to display IT processes like a mail system or a network infrastructure.',0,NULL,NULL),(100,5,31,5,5,'0','Ok','2014-02-11 10:56:21','2014-02-11 10:56:21','NetBeans','https://netbeans.org/index_fr.html','https://netbeans.org/','L\'EDI NetBeans est un environnement de développement - un outil pour les programmeurs pour écrire, compiler, déboguer et déployer des programmes. Il est écrit en Java - mais peut supporter n\'importe quel langage de programmation. Il y a également un grand nombre de modules pour étendre l\'EDI NetBeans. L\'EDI NetBeans est un produit gratuit, sans aucune restriction quant à son usage.\n\nÉgalement disponible, La Plateforme NetBeans; une fondation modulable et extensible utilisée comme brique logicielle pour la création d\'applications bureautiques. Les partenaires privilégiés fournissent des modules à valeurs rajoutées qui s\'intègrent facilement à la Plateforme et peuvent être utilisés pour développer ses propres outils et solutions',0,'',NULL),(101,5,31,5,5,'0','Ok','2014-01-07 12:05:37','2014-01-27 12:05:37','NetworkWeatherMap','http://www.network-weathermap.com/',NULL,'Weathermap is a network visualisation tool, to take data you already have and show you an overview of your network in map form. ',0,NULL,NULL),(102,5,31,5,5,'0','Ok','2014-02-11 11:14:27','2014-02-11 11:14:27','neXtepDesigner','http://www.nextep-softwares.com/','http://www.nextep-softwares.com/wiki/index.php/NeXtep_Designer_Overview','NeXtep Open Designer is a powerful multi-vendor / multi-platform open source Integrated Development Environment (IDE) for database developments, focused on automation and productivity. It offers to automate database packaging operations by leveraging a version control engine which tracks any change you make to your database applications. It enables simple and safe deployment of your packaged developments through automatic validation of your database structure before and after deployment. High quality support is available through a worldwide community of users who provide continual testing and feedback.',0,'',NULL),(103,5,31,5,5,'0','Ok','2014-02-11 11:27:14','2014-02-11 11:27:14','Nginx','http://nginx.org/','','Nginx [engine x] is an HTTP and reverse proxy server, as well as a mail proxy server, written by Igor Sysoev. For a long time, it has been running on many heavily loaded Russian sites including Yandex, Mail.Ru, VKontakte, and Rambler. According to Netcraft nginx served or proxied 15.91% busiest sites in January 2014.',0,'',NULL),(104,5,31,5,5,'0','Ok','2014-01-07 12:05:40','2014-01-27 12:05:40','Nmap','http://nmap.org/',NULL,'Nmap (\"Network Mapper\") is a free and open source (license) utility for network discovery and security auditing. Many systems and network administrators also find it useful for tasks such as network inventory, managing service upgrade schedules, and monitoring host or service uptime. ',0,NULL,NULL),(105,5,31,5,5,'0','Ok','2014-02-11 11:48:57','2014-02-11 11:48:57','Notepad++','http://notepad-plus-plus.org/','','Notepad++ est un éditeur de code source qui prend en charge plusieurs langages. Ce programme, codé en C++ avec STL et win32 api, a pour vocation de fournir un éditeur de code source de taille réduite mais très performant.',0,'',NULL),(106,5,31,5,5,'0','Ok','2014-01-07 12:05:42','2014-01-27 12:05:42','NSIS','http://nsis.sourceforge.net/',NULL,'NSIS (Nullsoft Scriptable Install System) is a professional open source system to create Windows installers. It is designed to be as small and flexible as possible and is therefore very suitable for internet distribution. ',0,NULL,NULL),(107,5,31,5,5,'0','Ok','2014-02-11 12:36:22','2014-02-11 12:36:22','ntopng','http://www.ntop.org/','','Ntopng is the next generation version of the original ntop, a network traffic probe that shows the network usage, similar to what the popular top Unix command does',0,'',NULL),(108,5,31,5,5,'0','Ok','2014-01-07 12:05:44','2014-01-27 12:05:44','OCSInventory','http://www.ocsinventory-ng.org/fr/',NULL,'Open Computers and Software Inventory Next Generation est une solution de gestion technique de parc informatique.',0,NULL,NULL),(109,5,31,5,5,'0','Ok','2014-01-07 12:05:45','2014-01-27 12:05:45','OpenErp','https://www.openerp.com/',NULL,'Beautiful Business Applications, Powerful, Integrated, Open Source,',0,NULL,NULL),(110,5,31,5,5,'0','Ok','2014-01-07 12:05:46','2014-01-27 12:05:46','OPENMEETINGS','http://openmeetings.apache.org/',NULL,'Openmeetings provides video conferencing, instant messaging, white board, collaborative document editing and other groupware tools using API functions of the Red5 Streaming Server for Remoting and Streaming.  OpenMeetings is a project of the Apache, the old project website at GoogleCode will receive no updates anymore. The website at Apache is the only place that receives updates. ',0,NULL,NULL),(111,5,31,5,5,'0','Ok','2014-02-12 09:26:37','2014-02-12 09:26:37','OpenOLAP','http://r-kajiyama.sourceforge.net/','http://sourceforge.net/projects/r-kajiyama/?source=navbar','An open source OLAP tool for MySQL. OpenOLAP for MySQL has both R-OLAP and M-OLAP functions. The team from Nomura Research Institute, Ltd. has migrated OpenOLAP to work with MySQL5.0.x. since original version of OpenOLAP had worked only with PostgreSQL',0,'',NULL),(112,5,31,5,5,'0','Ok','2014-01-07 12:05:48','2014-01-27 12:05:48','OpenSSL','http://www.openssl.org/',NULL,'The OpenSSL Project is a collaborative effort to develop a robust, commercial-grade, full-featured, and Open Source toolkit implementing the Secure Sockets Layer (SSL v2/v3) and Transport Layer Security (TLS v1) protocols as well as a full-strength general purpose cryptography library.',0,NULL,NULL),(114,5,31,5,5,'0','Ok','2014-01-07 12:05:50','2014-01-27 12:05:50','OpenBSD','http://www.openbsd.org/fr/index.html',NULL,'Le projet OpenBSD fournit un système d\'exploitation de type UNIX LIBRE, multiplates-formes et basé sur 4.4BSD. Nos efforts portent sur la portabilité, la standardisation, l\'exactitude, la sécurité proactive et la cryptographie intégrée. ',0,NULL,NULL),(115,5,31,5,5,'0','Ok','2014-01-07 12:05:51','2014-01-27 12:05:51','Openfire','http://www.igniterealtime.org/',NULL,'Openfire (formerly Wildfire) is a cross-platform real-time collaboration server based on the XMPP (Jabber) protocol.',0,NULL,NULL),(116,5,31,5,5,'0','Ok','2014-01-07 12:05:52','2014-01-27 12:05:52','OpenLDAP','http://www.openldap.org/',NULL,'OpenLDAP Software is an open source implementation of the Lightweight Directory Access Protocol. ',0,NULL,NULL),(117,5,31,5,5,'0','Ok','2014-01-07 12:05:53','2014-01-27 12:05:53','OpenOffice.org','http://www.openoffice.org/fr/',NULL,'Si vous êtes à la recherche d\'une suite logicielle complète et efficace pour gérer vos documents bureautique, OpenOffice est le programme parfait pour optimiser vos performances et celles de vos utilisateurs, sans devoir payer de coûteuses licences.',0,NULL,NULL),(118,5,31,5,5,'0','Ok','2014-01-07 12:05:54','2014-01-27 12:05:54','OpenProj','http://sourceforge.net/projects/openproj/',NULL,'OpenProj is an open-source desktop project management application similar to Microsoft Project. OpenProj has a familiar user interface and even opens existing MS Project files. OpenProj is interoperable with Project, Gantt Charts and PERT charts.',0,NULL,NULL),(120,5,31,5,5,'0','Ok','2014-01-07 12:05:56','2014-01-27 12:05:56','OpenSSH','http://www.openssh.com/fr/index.html','http://www.openssh.org/','OpenSSH est une version LIBRE du protocole SSH de connexion réseau utilisé par les utilisateurs techniques de l\'Internet. Les utilisateurs de telnet, rlogin, et ftp ne réalisent pas que leur mot de passe est transmis non chiffré à travers Internet. OpenSSH chiffre tout le trafic (mots de passe inclus) de façon à déjouer les écoutes réseau, les prises de contrôle de connexion, et autres attaques réseaux. ',0,NULL,NULL),(121,5,31,5,5,'0','Ok','2014-01-07 12:05:57','2014-01-27 12:05:57','OpenVPN','http://openvpn.net/',NULL,'OpenVPN Technologies has designed and deployed a virtual network software that provides secure, reliable, and scalable communication services, not only fulfilling the requirements of the traditional virtual private network (VPN) market, but also addressing the demands of next wave web-scale VPN services.',0,NULL,NULL),(122,5,31,5,5,'0','Ok','2014-01-07 12:05:58','2014-01-27 12:05:58','Ossec','http://www.ossec.net/',NULL,'OSSEC is an Open Source Host-based Intrusion Detection System that performs log analysis, file integrity checking, policy monitoring, rootkit detection, real-time alerting and active response. ',0,NULL,NULL),(123,5,31,5,5,'0','Ok','2014-02-12 10:54:36','2014-02-12 10:54:36','Oubliette','http://www.tranglos.com/free/oubliette.html','http://sourceforge.net/projects/oubliette/','Oubliette: Store passwords, PINs, and other sensitive information in a highly secure manner. Open source.',0,'',NULL),(124,5,31,5,5,'0','Ok','2014-01-07 12:06:00','2014-01-27 12:06:00','PDFSAM','http://pdfsam.org/',NULL,'PDF Split And Merge (pdfsam) est un utilitaire qui permet de réaliser certaines manipulations avec des fichiers PDF. Pdfsam se décline en deux version. Une version \"basic\" permettant d’effectuer déjà bien des tâches et une version \"enhanced\" (avancée). Cette dernière offre en plus le chiffrement, la couverture et l’assemblage (alterné). À condition de verser une contribution d’au moins un euro, vous avez accès (à vie) à toutes les versions.',0,NULL,NULL),(125,5,31,5,5,'0','Ok','2014-01-07 12:06:01','2014-01-27 12:06:01','PDFCreator','http://www.pdfforge.org/',NULL,'PDFCreator (écrit en un seul mot, à ne pas confondre avec son homonyme \"PDF Creator\", écrit en deux mots séparés par un espace, qui, lui, est payant et non libre) est un projet allemand permettant de convertir très facilement des fichiers imprimables en fichiers PDF (via le format PostScript). Framasoft.net publie la mise en garde suivante : « Depuis 2009 (version 0.9.7), ce logiciel ajoute dans le processus d’installation une barre d’outils controversée. Au fil des années, le code libre a été progressivement remplacé par des librairies fermées. Dans sa dernière version, PDF Creator s’installe avec un autre logiciel (imposé par défaut en plus de la barre d’outils) - PDF Architect - qui ne contient aucun composant libre. »',0,NULL,NULL),(126,5,31,5,5,'0','Ok','2014-01-07 12:06:02','2014-01-27 12:06:02','Perl','http://www.perl.org/',NULL,'Perl est un langage de programmation créé par Larry Wall en 1987 et reprenant certaines fonctionnalités du langage C et des langages de scripts sed, awk et shell (sh). \r\nC\'est un langage interprété, polyvalent et adapté au traitement et à la manipulation de fichiers texte, notamment du fait de l\'intégration des expressions régulières dans la syntaxe même du langage. Perl est né du besoin de disposer d\'un langage optimisé pour l\'extraction d\'informations de fichiers texte et la génération de rapports.',0,NULL,NULL),(127,5,31,5,5,'0','Ok','2014-01-07 12:06:03','2014-01-27 12:06:03','PHP','http://www.php.net/',NULL,'PHP: Hypertext Preprocessor, plus connu sous son sigle PHP (acronyme récursif), est un langage de programmation libre principalement utilisé pour produire des pages Web dynamiques via un serveur HTTP, mais pouvant également fonctionner comme n\'importe quel langage interprété de façon locale. PHP est un langage impératif orienté-objet.',0,NULL,NULL),(128,5,31,5,5,'0','Ok','2014-01-07 12:06:04','2014-01-27 12:06:04','Pidgin','http://pidgin.im/',NULL,'Pidgin (anciennement Gaim) est un logiciel libre client de messagerie instantanée multiprotocole et multiplate-forme permettant de se connecter, entre autres, à XMPP, IRC, ICQ/AIM, Google Talk, Yahoo! Messenger et Microsoft Messenger. Il est multilingue. Depuis la version 2.6, il supporte la vidéo et la VoIP pour le protocole XMPP (anciennement Jabber).',0,NULL,NULL),(129,5,31,5,5,'0','Ok','2014-01-07 12:06:05','2014-01-27 12:06:05','PortableApps.com Platform','http://portableapps.com/',NULL,'The PortableApps.com Platform™ is a full-featured portable software menu, backup utility, app store, automatic updater and application management system that ties all your portable apps together and lets you build your own custom portable app suite. The PortableApps.com Platform is 100% Free. Free to use. Free to share. And fully open source.',0,NULL,NULL),(130,5,31,5,5,'0','Ok','2014-01-07 12:06:06','2014-01-27 12:06:06','Postfix','http://www.postfix.org/',NULL,'Postfix est un serveur de messagerie électronique et un logiciel libre développé par Wietse Venema et plusieurs contributeurs. Il se charge de la livraison de courriers électroniques (courriels) et a été conçu comme une alternative plus rapide, plus facile à administrer et plus sécurisée que l\'historique Sendmail. Il est le serveur de courriel par défaut dans plusieurs systèmes de type UNIX, comme Mac OS X, NetBSD1, diverses distributions GNU/Linux, etc. Postfix est publié sous licence IBM Public License 1.0. C\'est une licence libre, mais incompatible avec la GPL.',0,NULL,NULL),(131,5,31,5,5,'0','Ok','2014-01-07 12:06:07','2014-01-27 12:06:07','PostgreSQL','http://www.postgresql.org/ ',NULL,'PostgreSQL est un système de gestion de base de données relationnelle et objet (SGBDRO). C\'est un outil libre disponible selon les termes d\'une licence de type BSD. Ce système est concurrent d\'autres systèmes de gestion de base de données, qu\'ils soient libres (comme MariaDB, MySQL et Firebird), ou propriétaires (comme Oracle, Sybase, DB2, Informix et Microsoft SQL Server). Comme les projets libres Apache et Linux, PostgreSQL n\'est pas contrôlé par une seule entreprise, mais est fondé sur une communauté mondiale de développeurs et d\'entreprises.',0,NULL,NULL),(132,5,31,5,5,'0','Ok','2014-01-07 12:06:08','2014-01-27 12:06:08','ProFTPD','http://www.proftpd.org/',NULL,'ProFTPD est un serveur FTP libre. Ses auteurs l\'annoncent comme puissant et parfaitement sécurisé sur le site web consacré au logiciel. Le logiciel permet de configurer plusieurs serveurs FTP virtuels et a la possibilité d\'être utilisé dans un environnement dédié (chroot). Il peut être lancé comme un démon ou comme service inetd. Enfin, ProFTPD est compatible Ipv6.',0,NULL,NULL),(133,5,31,5,5,'0','Ok','2014-01-07 12:06:09','2014-01-27 12:06:09','PuTTY','http://www.chiark.greenend.org.uk/~sgtatham/putty/ ',NULL,'PuTTY est un émulateur de terminal doublé d\'un client pour les protocoles SSH, Telnet, rlogin, et TCP brut. Il permet également d\'établir des connexions directes par liaison série RS-232. À l\'origine disponible uniquement pour Windows, il est à présent porté sur diverses plates-formes Unix (et non-officiellement sur d\'autres plates-formes).',0,NULL,NULL),(134,5,31,5,5,'0','Ok','2014-01-07 12:06:10','2014-01-27 12:06:10','Python 2.7.6','http://www.python.org/',NULL,'Python est un langage de programmation objet, multi-paradigme et multi-plateformes. Il favorise la programmation impérative structurée et orientée objet. Il est doté d\'un typage dynamique fort, d\'une gestion automatique de la mémoire par ramasse-miettes et d\'un système de gestion d\'exceptions ',0,NULL,NULL),(135,5,31,5,5,'0','Ok','2014-02-12 12:21:47','2014-02-12 12:21:47','Qt','https://qt-project.org/','','Qt est une API orientée objet et développée en C++ par Qt Development Frameworks, filiale de Digia. Qt offre des composants d\'interface graphique (widgets), d\'accès aux données, de connexions réseaux, de gestion des fils d\'exécution, d\'analyse XML, etc. Par certains aspects, c\'est aussi un framework lorsqu\'on l\'utilise pour concevoir des interfaces graphiques ou que l\'on architecture son application en utilisant les mécanismes des signaux et slots par exemple. Qt permet la portabilité des applications qui n\'utilisent que ses composants par simple recompilation du code source.',0,'',NULL),(136,5,31,5,5,'0','Ok','2014-02-12 12:25:30','2014-02-12 12:25:30','rdesktop','http://www.rdesktop.org/#overview','','Rdesktop est un logiciel client libre pour le service RDP issu de serveurs Terminal Services. Il permet d\'accéder à un environnement applicatif windows à partir d\'un poste de travail Linux par exemple. Il est conçu pour être utilisé sur les plateformes X d\'UNIX et de linux.',1,'',NULL),(137,5,31,5,5,'0','Ok','2014-02-12 13:19:41','2014-02-12 13:19:41','RedHatEnterpriseLinux','http://www.redhat.com/products/enterprise-linux/','','Red Hat Enterprise Linux (souvent abrégé RHEL) est une distribution Linux produite par Red Hat et orientée vers le marché commercial et les serveurs d\'entreprise.',0,'',NULL),(138,5,31,5,5,'0','Ok','2014-01-07 12:06:14','2014-01-27 12:06:14','Redmine','http://www.redmine.org/',NULL,'Redmine est une application web libre de gestion de projets presque complète en mode web, développée en Ruby sur la base du framework Ruby on Rails. La gestion des tests devra être faite avec un autre outil.',0,NULL,NULL),(139,5,31,5,5,'0','Ok','2014-02-03 14:34:54','2014-02-03 14:34:54','Rsync','http://rsync.samba.org/','','Rsync remote synchronization, (en français : « synchronisation distante ») est un logiciel libre de synchronisation de fichiers, distribué sous licence GNU GPL. La synchronisation est unidirectionnelle, c\'est-à-dire qu\'elle copie les fichiers de la source en direction de la destination. rsync est donc utilisé pour réaliser des sauvegardes incrémentales ou pour diffuser le contenu d\'un répertoire de référence. Rsync fonctionne sur une large gamme de systèmes d\'exploitation (Microsoft Windows, GNU/Linux, Mac OS X), permettant ainsi de synchroniser des fichiers de différents systèmes d\'exploitation.',0,'',NULL),(140,5,31,5,5,'0','Ok','2014-01-07 12:06:10','2014-01-27 12:06:10','Python 3.3.3','http://www.python.org/',NULL,'Python est un langage de programmation objet, multi-paradigme et multi-plateformes. Il favorise la programmation impérative structurée et orientée objet. Il est doté d\'un typage dynamique fort, d\'une gestion automatique de la mémoire par ramasse-miettes et d\'un système de gestion d\'exceptions ',0,NULL,NULL),(141,5,31,5,5,'0','Ok','2014-01-07 12:06:16','2014-01-27 12:06:16','Samba','https://www.samba.org/',NULL,'Samba is the standard Windows interoperability suite of programs for Linux and Unix. Samba is Free Software licensed under the GNU General Public License, the Samba project is a member of the Software Freedom Conservancy. ',0,NULL,NULL),(142,5,31,5,5,'0','Ok','2014-01-07 12:06:17','2014-01-27 12:06:17','SharpDevelop','http://www.icsharpcode.net/opensource/sd/','http://sourceforge.net/projects/sharpdevelop/','SharpDevelop is the open-source IDE for the .NET platform. Write applications in languages including C#, VB.NET, F#, IronPython and IronRuby, as well as target rich and reach: Windows Forms or WPF, as well as ASP.NET MVC and WCF. It starts from USB drives, supports read-only projects, comes with integrated unit and performance testing tools, Git, NuGet and a lot more features that make you productive as a developer.',0,NULL,NULL),(143,5,31,5,5,'0','Ok','2014-01-07 12:06:18','2014-01-27 12:06:18','Snort','http://www.snort.org/',NULL,'Snort is an open source network intrusion prevention and detection system (IDS/IPS) developed by Sourcefire. Combining the benefits of signature, protocol, and anomaly-based inspection, Snort is the most widely deployed IDS/IPS technology worldwide.',0,NULL,NULL),(144,5,31,5,5,'0','Ok','2014-01-07 12:06:19','2014-01-27 12:06:19','Spark IM Client','http://www.igniterealtime.org/projects/spark/',NULL,'Spark is an Open Source, cross-platform IM client optimized for businesses and organizations. It features built-in support for group chat, telephony integration, and strong security. It also offers a great end-user experience with features like in-line spell checking, group chat room bookmarks, and tabbed conversations.',0,NULL,NULL),(145,5,31,5,5,'0','Ok','2014-01-07 12:06:20','2014-01-27 12:06:20','SQLTools','http://www.sqltools.net/','http://sqlt.sourceforge.net/','SQLTools is a light weight and robust frontend for Oracle database development. This program is not so comprehensive as Tora or TOAD but it is ideal when you need basic data querying capabilities and objects browsing. It also supports a basic subset of SQL*Plus commands (connect/disconnect, bind and define variables)',0,NULL,NULL),(146,5,31,5,5,'0','Ok','2014-01-07 12:06:21','2014-01-27 12:06:21','SQUID','http://www.squid-cache.org/','http://sourceforge.net/projects/squid/','Squid is a fully-featured HTTP/1.0 proxy which is almost (but not quite - we\'re getting there!) a fully-featured HTTP/1.1 proxy. Squid offers a rich access control, authorization and logging environment to develop web proxy and content serving applications. Squid offers a rich set of traffic optimization options, most of which are enabled by default for simpler installation and high performance. ',0,NULL,NULL),(147,5,31,5,5,'0','Ok','2014-02-13 10:23:19','2014-02-13 10:23:19','Apache Subversion','http://subversion.apache.org/','http://projects.apache.org/projects/subversion.html','Apache Subversion (often abbreviated SVN, after the command name svn) is a software versioning and revision control system distributed as free software under the Apache License.[1] Developers use Subversion to maintain current and historical versions of files such as source code, web pages, and documentation.',0,'',NULL),(148,5,31,5,5,'0','Ok','2014-01-07 12:06:23','2014-01-27 12:06:23','openSUSE','http://www.opensuse.org/fr/',NULL,'openSUSE est un système d\'exploitation libre et gratuit basé sur Linux pour votre ordinateur personnel, votre ordinateur portable ou votre serveur.',0,NULL,NULL),(149,5,31,5,5,'0','Ok','2014-01-07 12:06:24','2014-01-27 12:06:24','Syslog-ng Open Source Edition','http://www.balabit.com/fr/network-security/syslog-ng/opensource-logging-system','http://www.balabit.com/network-security/syslog-ng/','syslog-ng Open Source Edition™ est une solution syslog ultra portable qui permet de créer une infrastructure de journalisation sécurisée, flexible et fiable, pour les environnements de production.',0,NULL,NULL),(150,5,31,5,5,'0','Ok','2014-01-07 12:06:25','2014-01-27 12:06:25','Talend Open Studio','http://www.talend.com/','http://fr.talend.com/products/talend-open-studio','Talend Open Studio est un ensemble puissant et flexible de produits Open source pour développer, tester, déployer et administrer des projets de gestion de données et d’intégration d’applications.',0,NULL,NULL),(151,5,31,5,5,'0','Ok','2014-01-07 12:06:26','2014-01-27 12:06:26','TeraTerm','http://ttssh2.sourceforge.jp/','http://en.sourceforge.jp/projects/ttssh2/','Tera Term is Tera Term Pro 2.3 succession version and is being officially recognized by the original author. Tera Term is open source free software terminal emulator supporting UTF-8 protocol. Now TTSSH supports SSH2 protocol (Original version supports SSH1)',0,NULL,NULL),(152,5,31,5,5,'0','Ok','2014-01-07 12:06:27','2014-01-27 12:06:27','Testlink','http://www.testlink.org/','http://sourceforge.net/projects/testlink/','TestLink is a web based Test Management tool. The application provides Test specification, Test plans and execution, Reporting, Requirements specification and collaborate with well-known bug trackers.',0,NULL,NULL),(153,5,31,5,5,'0','Ok','2014-01-07 12:06:28','2014-01-27 12:06:28','Thunderbird','http://www.mozilla.org/thunderbird/',NULL,'Thunderbird is a free, open-source, cross-platform application for managing email and news feeds. It is a local (rather than a web-based) email application that is powerful yet easy-to-use',0,NULL,NULL),(154,5,31,5,5,'0','Ok','2014-01-07 12:06:29','2014-01-27 12:06:29','TightVNC','http://www.tightvnc.com/',NULL,'TightVNC is a free remote control software package. With TightVNC, you can see the desktop of a remote machine and control it with your local mouse and keyboard, just like you would do it sitting in the front of that computer.',0,NULL,NULL),(155,5,31,5,5,'0','Ok','2014-01-07 12:06:30','2014-01-27 12:06:30','TikiWiki','http://tiki.org/','http://sourceforge.net/projects/tikiwiki/','A full-featured, web-based, multilingual (40+ languages), tightly integrated, all-in-one Wiki+CMS+Groupware',0,NULL,NULL),(156,5,31,5,5,'0','Ok','2014-01-07 12:06:31','2014-01-27 12:06:31','Tortoise SVN','http://tortoisesvn.net/about.html',NULL,'TortoiseSVN is an Apache™ Subversion (SVN)® client, implemented as a windows shell extension.',0,NULL,NULL),(157,5,31,5,5,'0','Ok','2014-01-07 12:06:32','2014-01-27 12:06:32','Typo3','http://typo3.org/',NULL,'TYPO3 CMS is an enterprise-class, Open Source CMS (Content Management System), used internationally to build and manage websites of all types, from small sites for non-profits to multilingual enterprise solutions for large corporations.',0,NULL,NULL),(158,5,31,5,5,'0','Ok','2014-01-07 12:06:33','2014-01-27 12:06:33','Ubuntu','http://ubuntu.com/',NULL,'Ubuntu is a Debian-based Linux operating system, with Unity as its default desktop environment (formerly GNOME).',0,NULL,NULL),(159,5,31,5,5,'0','Ok','2014-01-07 12:06:34','2014-01-27 12:06:34','UltraDefragmenter','http://ultradefrag.sourceforge.net/en/index.html','http://sourceforge.net/projects/ultradefrag/','UltraDefrag is a powerful Open Source Defragmentation tool for the Windows Platform. It can defragment any system files including registry hives and paging file. Also one of the main goals of UltraDefrag is doing the job as fast and reliable as possible.',0,NULL,NULL),(160,5,31,5,5,'0','Ok','2014-01-07 12:06:35','2014-01-27 12:06:35','UltraVNC','http://www.uvnc.com/',NULL,'UltraVNC is a powerful, easy to use and free software that can display the screen of another computer (via internet or network) on your own screen. The program allows you to use your mouse and keyboard to control the other PC remotely. It means that you can work on a remote computer, as if you were sitting in front of it, right from your current location.',0,NULL,NULL),(161,5,31,5,5,'0','Ok','2014-01-07 12:06:36','2014-01-27 12:06:36','VirtualBOX','https://www.virtualbox.org/',NULL,'VirtualBox is a general-purpose full virtualizer for x86 hardware, targeted at server, desktop and embedded use. ',0,NULL,NULL),(162,5,31,5,5,'0','Ok','2014-01-07 12:06:37','2014-01-27 12:06:37','Vistumbler','http://www.vistumbler.net/index.html',NULL,'A wireless network scanner written in AutoIT for Vista, Windows 7, and Windows 8.',0,NULL,NULL),(163,5,31,5,5,'0','Ok','2014-01-07 12:06:38','2014-01-27 12:06:38','VLCmediaplayer','http://www.videolan.org/vlc/',NULL,'VLC is a free and open source cross-platform multimedia player and framework that plays most multimedia files as well as DVD, Audio CD, VCD, and various streaming protocols. ',0,NULL,NULL),(164,5,31,5,5,'0','Ok','2014-01-07 12:06:39','2014-01-27 12:06:39','Vyatta','http://www.vyatta.org/',NULL,'Vyatta\'s open, software-based approach to networking has created a complete network OS that can connect and secure physical networks as well as virtual and cloud computing infrastructures.',0,NULL,NULL),(165,5,31,5,5,'0','Ok','2014-01-07 12:06:40','2014-01-27 12:06:40','WampServer','http://www.wampserver.com/',NULL,'WampServer est une plate-forme de développement Web sous Windows pour des applications Web dynamiques à l’aide du serveur Apache2, du langage de scripts PHP et d’une base de données MySQL. Il possède également PHPMyAdmin pour gérer plus facilement vos bases de données.',0,NULL,NULL),(166,5,31,5,5,'0','Ok','2014-01-07 12:06:41','2014-01-27 12:06:41','WinDirStat','http://windirstat.info/',NULL,'WinDirStat is a disk usage statistics viewer and cleanup tool for various versions of Microsoft Windows.',0,NULL,NULL),(167,5,31,5,5,'0','Ok','2014-01-07 12:06:42','2014-01-27 12:06:42','Winff','http://winff.org/html_new/',NULL,'WinFF is a GUI for the command line video converter, FFMPEG. It will convert most any video file that FFmpeg will convert.',0,NULL,NULL),(168,5,31,5,5,'0','Ok','2014-01-07 12:06:43','2014-01-27 12:06:43','WinMerge','http://winmerge.org/about/?lang=fr',NULL,'WinMerge est un outil Open Source de différenciation et de fusion pour Windows. WinMerge peut comparer et les dossiers et les fichiers, en repésentant les différences dans un fichier texte visuel qui est facile à comprendre ou manipuler.',0,NULL,NULL),(169,5,31,5,5,'0','Ok','2014-01-07 12:06:44','2014-01-27 12:06:44','WinSCP','http://winscp.net/eng/docs/lang:fr',NULL,'WinSCP est un client SFTP graphique pour Windows. Il utilise SSH et est open source. Le protocole SCP est également supporté. Le but de ce programme est de permettre la copie sécurisée de fichiers entre un ordinateur local et un ordinateur distant. ',0,NULL,NULL),(170,5,31,5,5,'0','Ok','2014-01-07 12:06:45','2014-01-27 12:06:45','WinUAE','http://www.winuae.net/','http://sourceforge.net/projects/winuae/','A windows port of UAE, an emulation of the Amiga computer systems.',0,NULL,NULL),(171,5,31,5,5,'0','Ok','2014-01-07 12:06:47','2014-01-27 12:06:47','WordPress','http://wordpress.org',NULL,'WordPress is a free and open source blogging tool and a content management system (CMS) based on PHP and MySQL, which runs on a web hosting service.',0,NULL,NULL),(172,5,31,5,5,'0','Ok','2014-01-07 12:06:48','2014-01-27 12:06:48','WPKG','http://wpkg.org',NULL,'WPKG is an automated software deployment, upgrade and removal program for Windows. It can be used to push/pull software packages, such as Service Packs, hotfixes, or program installations from a central server (for example, Samba or Active Directory) to a number of workstations. ',0,NULL,NULL),(173,5,31,5,5,'0','Ok','2014-01-07 12:06:49','2014-01-27 12:06:49','XAMPP','http://www.apachefriends.org/index.html','http://sourceforge.net/projects/xampp/','XAMPP est une distribution Apache entièrement gratuite, facile à installer qui contient MySQL, PHP et Perl. ',0,NULL,NULL),(174,5,31,5,5,'0','Ok','2014-01-07 12:06:50','2014-01-27 12:06:50','Xen','http://www.xenproject.org/',NULL,'Xen is a virtual machine monitor (VMM) for x86-compatible computers. Xen can securely execute multiple virtual machines, each running its own OS, on a single physical system with close-to-native performance. ',0,NULL,NULL),(175,5,31,5,5,'0','Ok','2014-01-07 12:06:51','2014-01-27 12:06:51','Xmind','http://www.xmind.net/',NULL,'Mind Mapping Tool',0,NULL,NULL),(176,5,31,5,5,'0','Ok','2014-01-07 12:06:52','2014-01-27 12:06:52','XviD','http://www.xvid.org',NULL,'Xvid is a video codec for PC, whereas codec is an abbreviation for [co]der/[dec]oder, hence describes a program to encode and decode digital video. ',0,NULL,NULL),(177,5,31,5,5,'0','Ok','2014-01-07 12:06:53','2014-01-27 12:06:53','Zabbix','http://www.zabbix.com/product.php',NULL,'ZABBIX is an enterprise-class open source distributed monitoring solution designed to monitor and track performance and availability of network servers, devices and other IT resources. It supports distributed and WEB monitoring, auto-discovery, and more. ',0,NULL,NULL);
