50,5,'0',NULL,'2013-10-15 16:05:14','2013-10-15 16:05:14',211,'{\"nom-logiciel\": \"MySQL Serveur\", \"uri-du-forum\": \"\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"200 M et plus, la taille varie selon la plateforme d\'installation\", \"format-paquetage\": \" \", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://dev.mysql.com/downloads/mysql/\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": null, \"uri-site-internet-logiciel\": \"https://www.mysql.com/\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"mySQLserver\"}'),(563,50,15,50,50,'0',NULL,'2013-08-09 14:19:31','2013-08-09 14:19:31',235,'{\"dep-fontio_id\": 543, \"dep-fontio\": \"drupal\", \"log-prerequis\": \"mySQLserver\", \"log-prerequis_id\": 560}'),(565,50,15,50,5,'0',NULL,'2013-10-03 13:52:00','2013-10-03 13:52:00',211,'{\"nom-logiciel\": \"PostgreSQL\", \"uri-du-forum\": \"\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"\", \"format-paquetage\": \" \", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://www.postgresql.org/download/\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"<p><span class=\\\"PRODUCTNAME\\\">PostgreSQL</span> is an\\n  object-relational database management system (<acronym class=\\\"ACRONYM\\\">ORDBMS</acronym>) based on <a href=\\\"http://s2k-ftp.CS.Berkeley.EDU:8000/postgres/postgres.html\\\" target=\\\"_top\\\"><span class=\\\"PRODUCTNAME\\\">POSTGRES, Version\\n  4.2</span></a>, developed at the University of California at\\n  Berkeley Computer Science Department. POSTGRES pioneered many\\n  concepts that only became available in some commercial database\\n  systems much later.</p>\\n\\n  <p><span class=\\\"PRODUCTNAME\\\">PostgreSQL</span> is an open-source\\n  descendant of this original Berkeley code. It supports a large\\n  part of the SQL standard and offers many modern features:</p><ul><li><span>complex queries</span></li><li><span>foreign keys</span></li><li><span>triggers</span></li><li><span>views</span></li><li><span>transactional integrity</span></li><li><span>multiversion concurrency control</span></li></ul><p>Also, <span class=\\\"PRODUCTNAME\\\">PostgreSQL</span> can be\\n  extended by the user in many ways, for example by adding new<span><br></span></p><ul><li><span>data types</span></li><li><span>functions</span></li><li><span>operators</span></li><li><span>aggregate functions</span></li><li><span>index methods</span></li><li><span>procedural languages</span></li></ul>And because of the liberal license, <span class=\\\"PRODUCTNAME\\\">PostgreSQL</span> can be used, modified, and\\n  distributed by anyone free of charge for any purpose, be it\\n  private, commercial, or academic.\", \"uri-site-internet-logiciel\": \"http://www.postgresql.org/\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"PostgreSQL\"}'),(566,50,15,50,5,'0',NULL,'2013-10-03 13:51:02','2013-10-03 13:51:02',211,'{\"nom-logiciel\": \"SQLite\", \"uri-du-forum\": \"\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"\", \"format-paquetage\": \" \", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://www.sqlite.org/download.html\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"SQLite is an in-process library that implements a\\n<a href=\\\"http://www.sqlite.org/selfcontained.html\\\">self-contained</a>, \\n<a href=\\\"http://www.sqlite.org/serverless.html\\\">serverless</a>,\\n<a href=\\\"http://www.sqlite.org/zeroconf.html\\\">zero-configuration</a>,\\n<a href=\\\"http://www.sqlite.org/transactional.html\\\">transactional</a>\\nSQL database engine.\\nThe code for SQLite is in the\\n<a href=\\\"http://www.sqlite.org/copyright.html\\\">public domain</a> and is thus free for\\nuse for any purpose, commercial or private.\\nSQLite is currently found in more applications than we can\\ncount, including several <a href=\\\"http://www.sqlite.org/famous.html\\\">high-profile projects.</a><br><br>SQLite is an embedded SQL database engine.\\nUnlike most other SQL databases, SQLite does not have a separate\\nserver process.  SQLite reads and writes directly to ordinary disk\\nfiles.  A complete SQL database with multiple tables, indices,\\ntriggers, and views, is contained in a single disk file.\\nThe database file format is cross-platform - you can freely copy a database\\nbetween 32-bit and 64-bit systems or between \\n<a href=\\\"http://en.wikipedia.org/wiki/Endianness\\\">big-endian</a> and\\n<a href=\\\"http://en.wikipedia.org/wiki/Endianness\\\">little-endian</a>\\narchitectures.  These features make SQLite a popular choice as\\nan <a href=\\\"http://www.sqlite.org/whentouse.html#appfileformat\\\">Application File Format</a>.\\nThink of SQLite not as a replacement for \\n<a href=\\\"http://www.oracle.com/database/index.html\\\">Oracle</a> but\\nas a replacement for <a href=\\\"http://man.he.net/man3/fopen\\\">fopen()</a>\", \"uri-site-internet-logiciel\": \"http://www.sqlite.org/\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"SQLite\"}'),(567,50,15,50,50,'0',NULL,'2013-08-12 09:54:27','2013-08-12 09:54:27',235,'{\"dep-fontio_id\": 565, \"dep-fontio\": \"PostgreSQL\", \"log-prerequis\": \"drupal\", \"log-prerequis_id\": 543}'),(568,50,15,50,50,'0',NULL,'2013-08-12 09:54:39','2013-08-12 09:54:39',235,'{\"dep-fontio_id\": 566, \"dep-fontio\": \"SQLite\", \"log-prerequis\": \"drupal\", \"log-prerequis_id\": 543}'),(569,50,15,50,50,'0',NULL,'2013-08-12 09:55:26','2013-08-12 09:55:26',235,'{\"dep-fontio_id\": 543, \"dep-fontio\": \"drupal\", \"log-prerequis\": \"PostgreSQL\", \"log-prerequis_id\": 565}'),(570,50,15,50,50,'0',NULL,'2013-08-12 09:55:36','2013-08-12 09:55:36',235,'{\"dep-fontio_id\": 543, \"dep-fontio\": \"drupal\", \"log-prerequis\": \"SQLite\", \"log-prerequis_id\": 566}'),(571,50,15,50,50,'0',NULL,'2013-09-13 10:36:50','2013-09-13 10:36:50',222,'{\"annee-maj\": 0, \"format-document\": \"HTML\", \"type-document\": \"manuel\", \"auteur-document\": \"Contributi