ompression solide.\\n  </li><li>Compression des ent\\u00eates d\'archive.\\n</li></ul><p><b>LZMA</b> est la m\\u00e9thode de compression g\\u00e9n\\u00e9rale par d\\u00e9faut du format <b>7z</b>.</p><ul><li>Taux de compression \\u00e9lev\\u00e9.\\n  </li><li>Taille du dictionnaire variable (jusqu\'\\u00e0 4 Go).\\n  </li><li>Vitesse de compression : environ 1 Mo/s sur un processeur \\u00e0 2 GHz.\\n  </li><li>Vitesse de d\\u00e9compression : environ 10-20 Mo/s sur un processeur \\u00e0 2 GHz.\\n  </li><li>Faible demande de m\\u00e9moire pour la d\\u00e9compression (selon la taille du dictionnaire).\\n  </li><li>Petite taille du code de d\\u00e9compression : environ 5 Ko.\\n  </li><li>Support du multi-threading et de l\'hyper-threading du P4.\\n</li></ul><br>\", \"uri-site-internet-logiciel\": \"http://www.spiroo.be/7zip/\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"7zi\"}'),(750,50,15,50,5,'0',NULL,'2013-10-03 15:19:20','2013-10-03 15:19:20',211,'{\"nom-logiciel\": \"AC3Filter\", \"uri-du-forum\": \"http://ac3filter.net/forum\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"\", \"format-paquetage\": \".exe\", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://www.ac3filter.net/wiki/Download_AC3Filter\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"\", \"uri-site-internet-logiciel\": \"http://www.ac3filter.net/\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"ac3fil\"}'),(752,50,15,50,5,'0',NULL,'2013-10-03 15:51:29','2013-10-03 15:51:29',211,'{\"nom-logiciel\": \"ActivePerl\", \"uri-du-forum\": \"http://community.activestate.com/forum\", \"fourche-logiciel_id\": null, \"taille-logiciel\": \"\", \"format-paquetage\": \"multi-format\", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://www.activestate.com/activeperl/downloads\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"\", \"uri-site-internet-logiciel\": \"http://www.activestate.com/activeperl\", \"fourche-logic