iption-logiciel\": \"Red Hat<sup>\\u00ae</sup> JBoss<sup>\\u00ae</sup> Web Server is a fully-integrated \\nand certified set of components for hosting of Java\\u2122  web applications. \\nIt combines the world\'s most deployed web server (Apache\\u2122  HTTP \\nServer),&nbsp; the top servlet engine (Apache\\u2122  Tomcat), load balancers \\n(mod_jk and mod_cluster), and the Tomcat Native library, with the best \\nsupport in middleware. JBoss Web Server simplifies the use of popular \\nopen source software by&nbsp; providing stable, enterprise-class versions of \\nApache software that is backed with long-term enterprise product \\nlife-cycles.&nbsp; <br>\", \"uri-site-internet-logiciel\": \"https://www.jboss.org/products/ews.html\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"jbosswebser\"}'),(1150,5,15,5,5,'0',NULL,'2013-10-03 14:30:22','2013-10-03 14:30:22',211,'{\"nom-logiciel\": \"Red Hat JBoss Data Grid\", \"uri-du-forum\": \"https://community.jboss.org/en/infinispan?view=discussions\", \"fourche-logiciel_id\": \"\", \"taille-logiciel\": \"\", \"format-paquetage\": \".deb\", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"https://www.jboss.org/products/jdg.html\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"An intelligent distributed caching solution, JBoss Data Grid \\nsupercharges today\'s modern applications, allowing developers to meet \\ntough requirements of high performance, availability, reliability, and \\nelastic scale. &nbsp;JBoss Data Grid provides compatibility with the existing\\n data tier as well as applications written in any languge, using any \\nframework and platform via multiple APIs such as memcached, HotRod, and \\nREST. &nbsp;With JBoss Data Grid, developers have a streamlined approach to \\nstanding up new applications, avoiding the challenges normally \\nassoicated with integrating applicaitons and traditional databases. \\n&nbsp;With included management tooling (via the JBoss Operations Network \\nplug-in) and advanced functionality, JBoss Data Grid is an ideal \\nsolution for cost-effectively supercharging today\'s modern applications.\", \"uri-site-internet-logiciel\": \"https://www.jboss.org/products/jdg.html\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"jbossdatgri\"}'),(1151,5,15,5,5,'0',NULL,'2013-10-03 14:32:16','2013-10-03 14:32:16',211,'{\"nom-logiciel\": \"Red Hat JBoss Portal\", \"uri-du-forum\": \"https://community.jboss.org/en/jbossjpp\", \"fourche-logiciel_id\": \"\", \"taille-logiciel\": \"\", \"format-paquetage\": \".deb\", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://www.jboss.org/products/jpp.html\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"Red Hat&nbsp;JBoss Portal is a lean portal solution for building high-impact,\\n self-service applications.&nbsp; It provides reliability and powerful \\nperformance with a track record of near-zero downtime and maintenance \\nalong with high-availability, clustering, caching, failover, \\nload-balancing, and distributed deployment features. Developer-friendly,\\n JBoss Portal Platform is a popular component in \\\"best-of-breed\\\" \\nsolutions where integration wtih existing systems and other JBoss \\nMiddleware are a priority.\", \"uri-site-internet-logiciel\": \"http://www.jboss.org/products/jpp.html\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"jbosspor\"}'),(1152,5,15,5,5,'0',NULL,'2013-10-03 14:56:44','2013-10-03 14:56:44',211,'{\"nom-logiciel\": \"Resin Web Server\", \"uri-du-forum\": \"http://forum.caucho.com/\", \"fourche-logiciel_id\": \"\", \"taille-logiciel\": \"\", \"format-paquetage\": \".deb\", \"recommande-gouv-quebec\": false, \"uri-telechargement-logiciel\": \"http://www.caucho.com/download/\", \"uri-site-communaute-gouv\": \"\", \"description-logiciel\": \"<p>Resin <strong>Web Server</strong> is a full web server that\\u2019s <strong>faster than Apache httpd</strong>. Resin\\u2019s web server includes reverse proxy, load balancing, URL \\nrewrites, FastCGI, and HTTP proxy cache. Known as a high performance \\napplication server with a fast web server, the site usage explosion was \\ninline with expectations.</p><p><a href=\\\"http://www.caucho.com/resin-4.0/admin/http-server.xtp\\\">Resin Web Server</a> includes the following:<br></p><ul><li>Powerful and Easy to configure <a href=\\\"http://caucho.com/resin-4.0/admin/http-rewrite.xtp\\\">URL rewrite rules</a></li><li>Easy to configure <a href=\\\"http://www.caucho.com/resin-4.0/admin/http-virtual-hosts.xtp\\\">Virtual Hosting</a></li><li><a href=\\\"http://wiki4.caucho.com/Web_Server:_Using_FastCGIProxy_to_Reverse_Proxy_to_Native_PHP\\\">FastCGI</a> so you can work with Python (Django), Ruby (RoR), native PHP, and more</li><li>Built-in <a href=\\\"http://www.caucho.com/resin-4.0/admin/http-proxy-cache.xtp\\\">HTTP proxy cache</a> so you can speed dynamic pages to near-static speeds</li><li>Built-in mod_php like support via <a href=\\\"http://www.caucho.com/projects-open-source/php-app-server-quercus/\\\">Quercus</a>, a PHP clone written in Java</li><li>Cluster aware <a href=\\\"http://www.caucho.com/resin-4.0/admin/cluster-load-balancer.xtp\\\">load balancer</a> that auto shares loads to new application server nodes</li><li>Security: Immune to buffer overflow attacks that plague other Web Servers (mostly Java with small, tight, fast JNI/C)</li></ul>\", \"uri-site-internet-logiciel\": \"http://www.caucho.com/resin-web-server/\", \"fourche-logiciel\": \"\", \"id-logiciel\": \"resinwebser\"}'),(1153,5,15,5,5,'0',NULL,'2013-10-03 15:03:38','2013-10-03 15:03:38',216,'{\"logi-lic\": \"7zi\", \"lic-gerant_id\": 349, \"logi-lic_id\": 749, \"lic-gerant\": \"glgpl21\"}'),(1154,5,15,5,5,'0',NULL,'2013-10-03 15:09:06','2013-10-03 15:09:06',215,'{\"id-licence\": \"resunRAR\", \"nom-licence\": \"Licence unRAR\", \"achronyme-licence\": \"unRAR\", \"type-licence\": \"\", \"uri-licence\": \"\"}'),(1155,5,15,5,5,'0',NULL,'2013-10-03 15:09:20','2