TTP Server\", \"uri-site-logiciel\": \"http://www.apache.org/\", \"recommande-gouv-quebec\": true, \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlog\": \"\", \"description-logiciel\": \"The Apache HTTP Server is an open-source HTTP server for modern operating systems including UNIX, Microsoft Windows, Mac OS/X and Netware. The goal of this project is to provide a secure, efficient and extensible server that provides HTTP services observing the current HTTP standards. Apache has been the most popular web server on the Internet since April of 1996. \"}'),(1311,5,31,5,5,'0',NULL,'2013-11-21 15:08:29','2013-11-21 15:08:29',325,'{\"fourlog_id\": \"\", \"nom-logiciel\": \"Nginx\", \"uri-site-logiciel\": \"http://wiki.nginx.org/Main\", \"recommande-gouv-quebec\": false, \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlog\": \"\", \"description-logiciel\": \"Nginx (pronounced engine-x) is a free, open-source, high-performance HTTP server and reverse proxy, as well as an IMAP/POP3 proxy server. Igor Sysoev started development of Nginx in 2002, with the first public release in 2004. Nginx now hosts nearly 12.18% (22.2M) of active sites across all domains. Nginx is known for its high performance, stability, rich feature set, simple configuration, and low resource consumption. \"}'),(1312,5,31,5,5,'0',NULL,'2013-11-21 15:10:34','2013-11-21 15:10:34',325,'{\"fourlog_id\": \"\", \"nom-logiciel\": \"MySQL\", \"uri-site-logiciel\": \"http://www.mysql.com/\", \"recommande-gouv-quebec\": false, \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlog\": \"\", \"description-logiciel\": \"MySQL is the world\'s most popular open source database. Whether you are a fast growing web property, technology ISV or large enterprise, MySQL can cost-effectively help you deliver high performance, scalable database applications.\"}'),(1313,5,31,5,5,'0',NULL,'2013-11-21 15:11:32','2013-11-21 15:11:32',325,'{\"fourlog_id\": \"\", \"nom-logiciel\": \"Postgresql\", \"uri-site-logiciel\": \"http://www.postgresql.org/\", \"recommande-gouv-quebec\": false, \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlog\": \"\", \"description-logiciel\": \"PostgreSQL is a powerful, open source object-relational database system. It has more than 15 years of active development and a proven architecture that has earned it a strong reputation for reliability, data integrity, and correctness. It runs on all major operating systems, including Linux, UNIX (AIX, BSD, HP-UX, SGI IRIX, Mac OS X, Solaris, Tru64), and Windows. It is fully ACID compliant, has full support for foreign keys, joins, views, triggers, and stored procedures (in multiple languages). It includes most SQL:2008 data types, including INTEGER, NUMERIC, BOOLEAN, CHAR, VARCHAR, DATE, INTERVAL, and TIMESTAMP. It also supports storage of binary large objects, including pictures, sounds, or video. It has native programming interfaces for C/C++, Java, .Net, Perl, Python, Ruby, Tcl, ODBC, among others, and exceptional documentation.\"}'),(1314,5,31,5,5,'0',NULL,'2013-11-21 15:12:21','2013-11-21 15:12:21',325,'{\"fourlog_id\": \"\", \"nom-logiciel\": \"SQLite\", \"uri-site-logiciel\": \"http://www.sqlite.org/\", \"recommande-gouv-quebec\": false, \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlog\": \"\", \"description-logiciel\": \"SQLite is a software library that implements a self-contained, serverless, zero-configuration, transactional SQL database engine.\"}'),(1315,5,31,5,5,'0',NULL,'2013-11-21 15:13:19','2013-11-21 15:13:19',325,'{\"fourlog_id\": \"\", \"nom-logiciel\": \"PHP\", \"uri-site-logiciel\": \"http://www.php.net/\", \"recommande-gouv-quebec\": false, \"uri-commu-gouv\": \"\", \"uri-site-alternatif\": \"\", \"fourlog\": \"\", \"description-logiciel\": \"PHP is a widely-used general-purpose scripting language that is especially suited for Web development and can be embedded into HTML.\"}'),(1316,5,31,5,5,'0',NULL,'2013-11-21 15:24:54','2013-